measurements.description:
Ten round, full, overlapping, pastel Broad Lip flowers and three buds on one arched inflorescence 100cm long;
	sepals and petals white with light pink venation radiating proximally;
	large, broad lip fuchsia, darker basally, calli yellow with pink overlay;
	column yellow with pink spotting basally, anther cap white; substance firm; texture matte.
